import React from 'react';

import './input.styles.scss';

const Input = props => {
  const { isEditing, input, onChange } = props
  if (isEditing) {
    return(
      <span className="todo-wrap" >
        <input value={input} onChange={(e) => onChange(e)} />
      </span> 
    ) 
  } else {
    return false
  }
}

export default Input;
